-- drop objects if exists
DROP TABLE IF exists plays;
DROP TABLE IF exists songs;
DROP TABLE IF exists users;

CREATE EXTENSION IF NOT EXISTS pgcrypto;

CREATE TABLE songs (
    id UUID DEFAULT gen_random_uuid() PRIMARY KEY,
    "songName" varchar NOT NULL,
    artist varchar NOT NULL,
    album varchar NOT NULL,
    writers varchar NOT NULL,
    "releaseYear" int4 NOT NULL,
    "createdAt" timestamp NOT NULL DEFAULT now(),
    "updatedAt" timestamp NOT NULL DEFAULT now()
);

CREATE TABLE users (
    id UUID DEFAULT gen_random_uuid() PRIMARY KEY,
    username VARCHAR(255) UNIQUE NOT NULL,
    name VARCHAR(255) NOT NULL,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
); 

CREATE TABLE plays (
    id UUID DEFAULT gen_random_uuid() PRIMARY KEY,
    "userId" UUID REFERENCES users(id),
    "songId" UUID REFERENCES songs(id),
    "playMonth" INT NOT NULL CHECK ("playMonth" BETWEEN 1 AND 12),
    "playYear" INT NOT NULL,
    "playCount" INT NOT NULL,
    "createdAt" timestamp NOT NULL DEFAULT now(),
    "updatedAt" timestamp NOT NULL DEFAULT now(),
    UNIQUE ("songId", "playMonth", "playYear")
);






